import React from "react";
import Button from "../../components/ui/button";

const FeedbackForm = () => (
  <div className="p-6">
    <h2 className="text-2xl font-bold">Submit Your Feedback</h2>
    <form className="flex flex-col gap-4 mt-4">
      <input type="text" placeholder="Your Name" className="p-2 border rounded" />
      <textarea placeholder="Your Feedback" className="p-2 border rounded" rows={4}></textarea>
      <Button>Submit</Button>  {/* âœ… Using the imported Button */}
    </form>
  </div>
);

export default FeedbackForm;
